INSERT INTO `product` VALUES (0,0,'CAT S60 (Dual Sim, Black, Special Import)',7432,'',' <p>Buy the CAT S60 Dual Sim from Connected Devices.</p>\n<p>Â </p>\n<p><strong>Note this product is a special import and cannot be returned as a Change of Mind. Special Import products carry a warranty of between 6 to 12 months supported exclusively by Connected Devices. For more info on this products warranty, please contact us.</strong></p>\n<span id=container class=pdpage>\n<section itemprop=description id=prod-description class=boxed>\n<ul>\n<li>Strengthened Die Cast Frame</li>\n<li>Drop proof to 1.8m, MIL Spec 810G</li>\n<li>Super bright display (typical 540 nits), Gorilla Glass 4</li>\n<li>\n<span>4.7 inches (~56.1% screen-to-body ratio)</span> HD capacitive multi-touch with auto wet finger &amp; glove support</li>\n<li>Optimised battery performance (3,800 mAh)</li>\n<li>High quality audio experience (&gt;105dB)</li>\n<li>Underwater 13MP main camera with dual flash, 5MP front-facing camera</li>\n<li>Incredible FLIR Thermal camera <span>Thermal imaging, heat palettes, temp. spot meter, geo-tagging, touch focus, face detection, panorama</span>\n</li>\n<li>Snapdragon 617 octa-core processor</li>\n<li>32GB ROM, 3GB RAM</li>\n<li>Android Marshmallow</li>\n<li>Waterproof to a depth of 5M for 1 hour</li>\n<li>Dual SIM</li>\n<li>4G LTE</li>\n</ul>\n</section>\n</span>\n<p>Â ','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','CAT',-1,-1,NULL,0,NULL),(1,0,'Huawei P Smart (2019, 64GB, Dual Sim, Blue, Special Import)',3632,'',' <p>Buy the Huawei P Smart (2019) Dual Sim in Blue from Connected Devices.</p>\n<p><br></p>\n<p>Designed for the 2019 mid-range market, Huaweis new P Smart is a stunning looking phone, featuring a large 6.21-inch Full View display with dewdrop notch and subtly curved edges. Available in glossy Midnight Black or head-turning AuUrora Blue, the P Smart 2019 is every bit the modern device.</p>\n<p><br>Dual 13 &amp; 2 MP cameras adorn the back of the phone, making use of Huaweis AI Camera modes, thanks to the advanced Neural Processing Unit in the phones Kirin 710 processor. This intelligently scans the scene to select the correct shooting modes based on lighting and subject(s). 22 image categories and over 500 scenarios are chosen from instantly to ensure you get the best shot.</p>\n<p><br>The front facing camera also has several filter modes and post-processing options, as well as doubling up as a secure face-unlock system. <br>A powerful 3,400 mAh battery keeps you running all day, plus Huaweis fast-charging system gets you up and running quickly if you start to run low on power through a long day.</p>\n<p><br>Certified by TUV Rheinland, Huawei has also included an Eye Comfort mode. This reduces blue light and makes it safer to read long articles or have long periods of screen time, especially when viewing in low-light.<strong> <br></strong></p>\n<p><strong>Reasons to buy Huawei P Smart (2019)<br></strong>* Android 9 (Pie) with Huawei EMUI 9.0<br>* 6.21-inch display with Full HD+ 1080 x 2340 resolution and 19.5:9 ratio<br>* Octa-core Kirin 710 processor with Neural Processing Unit<br>* Dual rear camera 13MP + 2MP with AI camera enhancements<br>* Smart Split screen â€“ run two apps side by side<br>* Eye Comfort Mode<br>* Hands-free selfie<br>* Rear-mounted Fingerprint sensor<br>* 3,400 mAh battery<strong><br></strong></p>\n<p><strong>Whats in the Box ?<br></strong>* Huawei P Smart (2019)<br>* Charger<br>* USB Cable<br>* Quick Start Guide<br>* Warranty Card<br>* Eject Tool<br>* TP Protective Film<strong><br></stron','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','Huawei',-1,-1,NULL,0,NULL),(2,0,'Huawei P10 Lite (32GB, Dual Sim, Midnight Black, Local Stock)',3232,'',' <p>Buy the Huawei P10 Lite 32GB Dual Sim in Midnight Black from Connected Devices.</p>\n<p>The Huawei P10 Lite is powered by 2.15GHz octa-core HiSilicon Kirin 658 processor and it comes with 3GB of RAM. The phone packs 32GB of internal storage that can be expanded up to 256GB via a microSD card. The Huawei P10 Lite packs a 12-megapixel primary camera on the rear and an 8-megapixel front shooter for selfies.<br><br>The slim, lightweight P10 lite features an elegant, curved glass screen with metal edges. Its designed for a comfortable grip, making it smooth and effortless to check your messages on the go, or snap a spontaneous photo.<br><br>2x more light with the new Leica selfie camera. You get cracking self portraits day or night. It even senses when more people get in the photo and automatically switches to wide-angle.</p>\n<p>The P10 lites high-performance processor means your phone stays quick and powerful throughout its life. It learns how you use it, meaning your favourite apps for chatting, browsing and gaming are faster to load and use.<br><br>As always, Huawei put safety and security at the forefront of their design, technology and vision. And this latest release is no exception. Unlock your phone in a breathtaking 0.3 seconds, using the P10 lites 360 degree fingerprint sensor.</p>\n<p><strong>Network:</strong><br><br>Network provider: Open to all networks<br>SIM card type: nano SIM.</p>\n<p><strong>Display and Design:</strong><br><br>5.2 inch LCD display.<br>Resolution 1080 x 1920 pixels.<br>With a density of 424 pixels per inch.<br>Touch screen.<br>Toughened glass.</p>\n<p><br><strong>Dimensions:</strong><br><br>Size H147, W146.5, D72mm.<br>Weight 146g.</p>\n<p><strong>Camera and Video:</strong><br><br>Rear camera 12MP.<br>Front camera 8MP.<br>Vid','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','Huawei',-1,-1,NULL,0,NULL),(3,0,'CAT S41 (32GB, Dual Sim, IP68, Black Grey, Special Import)',7432,'',' <p>Buy the CAT S41 (32GB) Dual Sim in Black Grey from Connected Devices.</p>\n<p><strong>Note this product is a special import and cannot be returned as a Change of Mind. Special Import products carry a warranty of between 6 to 12 months supported exclusively by Connected Devices. For more info on this products warranty, please contact us.</strong></p>\n<p><strong>Share the Power!<br></strong></p>\n<p>Cats branded smartphones have been critically praised and reached new levels of popularity in the past couple of years. With the new S41, they have produced a rugged smartphone with so much battery power it can charge other products with its Battery Share feature.</p>\n<p>Built to handle extreme conditions with a specification beyond IP68, the Cat S41 will keep on working underwater or in harsh environments.<strong><br></strong></p>\n<p><strong>Reason to buy the CAT S41</strong></p>\n<p>* Android 7 Nougat &amp; productivity apps (Battery Share, AVG, Office Suite, File Commander, App Toolbox)<br>* 5-inch Full HD (1920 x 1080) screen<br>* Corning Gorilla Glass 5<br>* 2.3 GHz Octa-core processor<br>* 13MP main camera with PDAF &amp; LED flash<br>* 8MP selfie camera<br>* Beyond IP68 - water-resistant to 2m for 60 minutes <br>* Strengthened die-cast frame<br>* Drop proof to 1.8m<br>* Huge 5,000 mAh battery<br>* Power Share app lets you use the S41 as a power bank</p>\n<p>The S41 is a dual-SIM device, with 2x Nano SIM card slots. You can use SIM cards from network providers of your choice.</p>\n<p>Use both a personal and work SIM card in the same phone or maybe a local and international SIM, the choice is yours. Or if you need only one SIM slot, leave the other empty.</p>\n<p><strong>Overview</strong></p>\n<p>Over the past few years, Cat has changed the perception of rugged smartphones. Not too long ago, a rugged phone was often expensive and underpowered all at once. Cat changed that with the original Cat B15 Toughphone: a game-changing product that was both affordable and carried a decent specification.</p>\n<p>They havent looked back and the S41 is an example of their vision in the rugged category. With a solid, robust design, the Cat S41 ticks all of the boxes required for a rugged product. It even goes beyond the standard IP68 dust and water-resistance rating.</p>\n<p>But theres more than just that. The S41 is a high-quality modern smartphone too, with Android 7 Nougat, octa-core processing, a Full HD screen, Android Pay certification and other features, all at an affordable price point. <br><strong></strong></p>\n<p><strong>Take Charge</strong></p>\n<p>Ask anyone what they want from a smartphone and the answer will probably be longer battery life!</p>\n<p>The Cat S41 answers those calls with a huge 5,000 mAh cell. In standard conditions, this big battery can deliver up to 38 hours continuous talk time on a 3G connection. Left alone thats up to 44 days on standby.</p>\n<p>No more rushing around to find a charger for the trip home, or realising youre almost out of juice because you stopped out for a few hours after work. With the S41 you can get to the end of every long day with power to spare. <strong><br></strong></p>\n<p><strong>Additional Features</strong></p>\n<p><em>Glove Mode</em></p>\n<p>Accessible from the settings, Glove Mode changes the sensitivity settings of the screen so that it is compatible with gloved hands.</p>\n<p><em>Easy Grip Design</em><br>Wrapping around the whole handset is a textured, grippy finish. The keeps the phone stuck to the spot, even when rested on inclines and slippy surfaces.<br>Its also easy to locate in a deep pocket or bag and easier to hold in the hand than the glossy, anodised finished of comparable fashion-style smartphones.</p>\n<p><em>Push To Talk</em><br>If using several S41 handsets for a group of workers or another such team, the PTT button can be utilised with compatible apps for immediate short to medium range communication.</p>\n<p><em>SOS / Lone Worker App</em><br>Pre-installed on the Cat S41 is a lone worker app that can be customised. Through this app, a worker in distress or in need of attention can quickly call for assistance, with options to share GPS location.</p>\n<p><em>Easy Read Display</em><br>Alongside the Glove Mode mentioned above, the Cat S41 screen has also been designed to minimise glare from direct sunlight and other sources of bright light.</p>\n<p><em>App Toolbox</em><br>Looking for some useful and relevant applications? Sick of filtering through thousands of silly games and distractions on the Play Store? With the App Toolbox, you can browse','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','CAT',-1,-1,NULL,0,NULL),(4,0,'Huawei Mate 20 Lite (64GB, Dual Sim, Blue, Special Import)',4732,'',' <p>Buy the Huawei Mate 20 Lite (64GB) Dual Sim in Blue from Connected Devices.</p>\n<p><strong>Note this product is a special import and cannot be returned as a Change of Mind. Special Import products carry a warranty of between 6 to 12 months supported exclusively by Connected Devices. For more info on this products warranty, please contact us.</strong></p>\n<p>Own Tomorrow.</p>\n<p>The latest AI-powered smartphone from Huawei, the Mate 20 Lite features a quad-camera set up - two on the front and two on the back.</p>\n<p>Huaweis own HiSilicon Kirin 710 processor powers everything, utilising a dedicated neural engine which enhances photography, video recording, gaming and other intensive applications.</p>\n<p>An immersive 6.3 FullView display dominates the screen providing a stunning window to the world. Plus Huaweis EMUI additions to the Android 8.1 operating system allow you to customise the phone for a unique and personal interface.<strong><br></strong></p>\n<p><strong>Reasons to buy the Huawei Mate 20 Lite</strong><br>* Android 8.1 (Oreo) with EMUI 8.2<br>* Dual rear cameras with 20MP RGB and 2MP monochrome lenses<br>* Dual selfie cameras (24MP &amp; 2MP) with portrait lighting and depth effects<br>* 6.3-inch Full View Display (2340 x 1080)<br>* Huawei Kirin 710 octa-core processor with AI Neural Engine<br>* 64GB storage &amp; microSD support (up to 256GB - uses SIM 2 slot)<br>* Wi-Fi 802.11 a/b/g/n/ac &amp; Bluetooth 4.2<br>* Real-time face unlock<br>* 3,750 mAh battery &amp; Huawei SuperCharge<br>* USB Type-C &amp; 3.5mm audio jac','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','Huawei',-1,-1,NULL,0,NULL),(5,0,'Samsung Galaxy S9 (64GB, Midnight Black, Local Stock)',8732,'',' <p>Buy the Samsung Galaxy S9 (64GB) in Midnight Black from Connected Devices.</p>\n<p>ï»¿</p>\n<p><strong><img src=//cdn.shopify.com/s/files/1/1374/6193/files/Screen_Shot_2018-03-01_at_11.48.35_PM_grande.png?v=1519940972 alt=></strong></p>\n<p>The camera. Reimagined.</p>\n<p>In 2017 Samsung re-envisaged the smartphone screen with the Infinity Display, pushing the boundaries of contemporary design.</p>\n<p>For 2018, they have a similar trick for the camera. Using the human eye as inspiration the dual-aperture lens can automatically adapt to lighting conditions to provide the best possible images in bright or dark situations.</p>\n<p>When it comes to video recording, you can also slow down time with an incredible super slow-mo effect that you can be switched on during recording or turned into GIFs.<strong> <br></strong></p>\n<p><strong><br>Reasons to buy the Samsung Galaxy S9<br></strong>* Edge-to-edge Infinity Display with curved 3D glass<br>* Invisible pressure-sensitive home button<br>* Bixby Assistant for context-sensitive search, suggestions and navigation<br>* Samsung DeX desktop dock compatible <br>* High-resolution rear-mounted Fingerprint Sensor - (screen locking and payments with Samsung Pay / Android Pay)<br>* High-speed face recognition screen unlocking<br>* Iris scanner screen unlocking technology<strong><br></strong></p>\n<p><strong>Samsung Galaxy S9 Quick Specifications<br></strong>* Android 8 (Oreo) with Samsung Experience UI<br>* 5.8 inch QHD+ (1440 x 2960) display (18.5 : 9 ratio) - Always-On Super AMOLED<br>* Samsung Exynos Octa processor / 4GB RAM<br>* 64GB storage &amp; microSD support (up to 256GB)<br>* 12MP rear camera with OIS, dual pixel phase-detection autofocus<br>* 8MP selfie camera with autofocus<br>* Super Slo-mo video recording<br>* 3,000 mAh battery with fast charging and wireless charging (Qi or PMA)<br>* Bluetooth 5.0 / GPS / Dual-Band Wi-Fi / NFC<br>* Gorilla Glass 5 front &amp; back<br>* IP68 water and dust resistant<br>* 147.6 x 68.7 x 8.4 mm<br>* USB Type-C / 3.5mm audio jack / Dedicated Bixby button<strong><br></strong></p>\n<p><strong>Whats in the box ?<br></strong></p>\n<p>* Samsung Galaxy S9 - <br>* Premium Harman AKG headphones &amp; ear tips<br>* USB Cable<br>* Ejection Pin<br>* USB Power Adapter<br>* Quick Start Guide<br>* USB Connector(USB type-C)<br>* Micro USB Connector<br>* USB Connector Leaflet<strong><br></strong></p>\n<p><strong><iframe src=https://www.youtube.com/embed/5_-NKRVn7IQ allow=autoplay; encrypted-media allowfullscreen= width=425 height=239 frameborder=0></iframe>&thinsp;</strong></p>\n<p><strong><iframe src=https://www.youtube.com/embed/FI2CpNdaJAc allow=autoplay; encrypted-media allowfullscreen= width=425 height=239 frameborder=0></iframe>&thinsp;</strong></p>\n<p>Â','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','Samsung',-1,-1,NULL,0,NULL),(6,0,'Samsung Galaxy A50 (128GB, Dual Sim, Blue, Special Import)',6132,'',' <p>Buy the Samsung Galaxy A50 (128GB) Dual Sim in Blue from Connected Devices.</p>\n<p><strong>Note this product is a special import and cannot be returned as a Change of Mind. Special Import products carry a warranty of between 6 to 12 months supported exclusively by Connected Devices. For more info on this products warranty, please contact us.</strong></p>\n<p><strong>Please take note regarding Samsung Pay.</strong></p>\n<p>With its triple rear cameras offering stunning photo opportunities, and a 6.4â€ Infinity-U Display. The Samsung Galaxy A50 is a great option for anyone who is looking for a mid-range smartphone.</p>\n<p>It has a great-looking design which incorporates the Infinity-U Display to great effect. With the display size being maximised, due to the slim bezels. This enables you to enjoy your photos, movies and more on the Super AMOLED display. It has a resolution of 10810 x 2340 pixels, so everything appears in stunning detail.</p>\n<p>The triple rear cameras use a 25MP (f/1.7) Low light, 8MP (f/2.2) Ultra-wide and 5MP (f/2.2) Live Focus lens to produce amazing images. You can capture detailed images including immersive panorama landscapes. Or choose to be creative with the Live Focus which gives you control over the amount of background blur. With the Scene Optimizer ensuring that every shot you take is perfect.</p>\n<p>Capture more of the action with the incredible 123-degree Ultra-wide video lens. So, your videos look more like a professional movie. Slow down the action with the 240FPS Slow-motion video option and see every frame.<br>A 25MP (f/2.0) selfie camera ensures you can take great-looking portraits and share them with your friends.</p>\n<p>The powerful Exynos 9610 Octa-core processor benefits from 4GB or RAM being available and 128GB of internal storage. So, you can enjoy using the latest apps and graphically demand games without any slowdown.</p>\n<p>Keep the Samsung Galaxy A50 ready to use with 15W fast charging, which quickly tops up the 4,000 mAh battery. Meaning when you have finished using your phone at the end of the day, it can be quickly ready for more fun.<strong><br></strong></p>\n<p><strong>Samsung Pay</strong><br>If you order a Special Import then you may find that Samsung Pay is unavailable, even if it is supported in your country.<br>This is because Samsung restricts the use of Samsung Pay so that it only works with banks registered in the same country as the phones origin.<br>The origin country is recorded in the phones firmware and cannot be adjusted by end users.</p>\n<p>If you require the use of Samsung Pay in South Africa, we would recommend avoiding a Special Import, although if Google Pay is available and acceptable to you, this will be available to download and unaffected.</p>\n<p><strong>Dual SIM options</strong><br>Samsung manufactures the Galaxy A50 in both single &amp; hybrid dual SIM versions. If an option for sale on Connected Devices specifies DUAL SIM then it has the hybrid slot. If DUAL SIM is not mentioned in the option, please assume that it is the single SIM version of the handset.</p>\n<p><strong>Reasons to buy Samsung Galaxy A50</strong><br>* Android 9 (Pie) with One UI<br>* 6.4-inch 1080 x 2340 Super AMOLED Infinity-U display<br>* Samsung Exynos 9610 Octa processor<br>* 128 GB with 4GB RAM<br>* microSD support (up to 512GB)<br>* TRIPLE 25+8+5MP rear cameras with phase-detection autofocus<br>* 25MP selfie cameras with autofocus<br>* 4,000 mAh battery with fast charging<br>* Bluet','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','Samsung',-1,-1,NULL,0,NULL),(7,0,'Motorola Moto G7 Power (64GB, Dual Sim, Ceramic Black, Special Import)',3832,'',' <p>Buy the Motorola Moto G7 Power (64GB) Dual Sim in Ceramic Black from Connected Devices.</p>\n<p><strong>Note this product is a special import and cannot be returned as a Change of Mind. Special Import products carry a warranty of between 6 to 12 months supported exclusively by Connected Devices. For more info on this products warranty, please contact us.</strong></p>\n<p>The Moto G7 Power solves the problem of enjoying using your smartphone, without worrying about finding a power point. This is possible as it features an industry-leading 5000 mAh battery, for up to two days of usage on a single charge. The supplied Turbopower charger will also give you up to 9 hours of charge in around 15 minutes. Giving you more time to have fun with your smartphone.</p>\n<p>We all enjoy taking a photo, and with the 12MP rear camera on the Moto G7 Power, you will be able to capture fantastic photos. It has a sensor which features large 1.25um pixels for capturing a greater amount of light and improving results indoors, and at night.</p>\n<p>Smart camera software enhances zoom capabilities improving the clarity of images. Avoiding the loss of detail, which is typically associated with using a digital zoom. Enabling you to capture the image you want.<br>When taking self-portraits using the front-facing 8MP camera, you can add professional effects including background blur. Impress your friends and family with stunning images.</p>\n<p>A stunning 6.2â€ HD+ display with a 19:9 aspect ratio offers a big screen viewing experience. It has a 1570 x 720 resolution, allowing you to be fully immersed in your movies, games photos and more.<br>With the Qualcomm Snapdragon 632 octa-core processor, you will be able to do more on the move. Including playing demanding games, editing photos and running all your favourite apps. As it is backed up by 4GB of RAM ensuring all your interactions are responsive.<strong><br></strong></p>\n<p><strong>Reasons to Buy Moto G7 Power</strong><br>* Android 9 (Pie)<br>* Up to 60 hours of battery life â€“ over 2 days<br>* 6.2â€ HD+ display with 19:9 aspect ratio<br>* 12MP rear camera with large 1.25um pixels<br>* 8MP front-facing camera f2.2, 1.12um ','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','Motorola',-1,-1,NULL,0,NULL),(8,0,'Samsung Galaxy J7 Prime (Dual Sim, 16GB, Black, Local Stock)',3632,'',' <p>Buy the Samsung Galaxy J7 Prime (Dual Sim) in Black from Connected Devices.</p>\n<p>With a full metal body, stylish curved back and big 5.5â€ display, the Galaxy J7 Prime is a stylish smartphone. Capture special moments with the high resolution 13MP rear camera for crisp and clear photos. Plus the 8MP front facing camera has a selfie flash, so you can take a selfie with your friends â€“ even at night.</p>\n<p><strong>Product features:</strong><br>* 13MP f1.9 primary camera and 8MP f1.9 front facing camera<br>* 13.97 centimeters (5.5-inch) TFT capacitive touchscreen with 1080 x 1920 pixels FHD display with metal unibody and fingerprint sensor<br>* Android v6.0 Marshmallow operating system with Exynos octa core processor, 3GB RAM, 16GB internal memory expandable up to 256GB and dual SIM<br>* 3300mAH lithium-ion battery</p>\n<p><strong>Elegantly Refined</strong><br>Boasts a stunning metal unibody with zero camera protrusion to ensure an overall ultra slim design. Its enlarged screen features flowing curved edges for optimal viewing and comfortable single handed use.</p>\n<p><strong>Brighten up your Photos</strong><br>Featuring an F1.9 aperture that allows for bright images even in low light settings, its 13MP rear camera ensures that all that you capture is beautifully crisp with vivid detail.</p>\n<p><strong>Amazing Camera</strong><br>Its Wide Selfie function together with its 8MP front camera lets you fit more people in group shots and capture beautiful scenery as it was meant to be seen. You can even use your palm to take photos with ease.<br><strong></strong></p>\n<p><strong>Fingerprint Scanner</strong><br>Features a quick and secure solution to make sure that you are the only one that has access to your device. Its touch-based fingerprint sensor lets you unlock your device safely within a second.<br><strong></strong></p>\n<p><strong>Power Extended</strong><br>Now with even longer lasting battery power to pack in more multimedia and keep gamers in the action.</p>\n<p><strong>Specifications:</strong><br>- Operating System: Android 6.0 Marshmallow<br>- Processor: Octa-Core 1.6 GHz<br>- Memory: Internal: 16GB, RAM: 3GB<br>- Display: 5.5 HD, 1920 x 1080 pixels<br>- Camera: 13MP; Front: 8MP<br>- SIM Type: Dual-SIM (Nano)<br>- Network: GSM: 850, 900, 1800, 1900 MHz, LTE: Bands 1/2/4/5/7/8/12/17/30<br>- Wire','Phones',NULL,NULL,4,0,'',200,NULL,NULL,'0000-00-00 00:00:00','Samsung',-1,-1,NULL,0,NULL),(9,0,'Samsung Galaxy A50 (128GB, Dual Sim, White, Special Import)',6132,'',' <p>Buy the Samsung Galaxy A50 (128GB) Dual Sim in White from Connected Devices.</p>\n<p><strong>Note this product is a special import and cannot be returned as a Change of Mind. Special Import products carry a warranty of between 6 to 12 months supported exclusively by Connected Devices. F